common:
  api_name: bigquerystorage
  api_version: v1alpha1
  organization_name: google-cloud
  proto_deps:
    - name: google-common-protos
  src_proto_paths:
  - storage/v1alpha1
  - v3/row.proto
  - v3/table_reference.proto
  service_yaml: storage/v1alpha1/storage_v1alpha1.yaml
  gapic_yaml: storage/v1alpha1/bigquerystorage_gapic.yaml
artifacts:
- name: gapic_config
  type: GAPIC_CONFIG
- name: java_gapic
  type: GAPIC
  language: JAVA
- name: python_gapic
  type: GAPIC
  language: PYTHON
- name: nodejs_gapic
  type: GAPIC
  language: NODEJS
- name: php_gapic
  type: GAPIC
  language: PHP
- name: go_gapic
  type: GAPIC
  language: GO
- name: ruby_gapic
  type: GAPIC
  language: RUBY
- name: csharp_gapic
  type: GAPIC
  language: CSHARP
